import React from "react";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <h2 className="name">Ryan Reynolds</h2>
          <img
            className="circle-img card-img"
            src="https://bit.ly/3wkAfAl"
            alt="avatar_img"
          />
        </div>
        <div className="bottom" className="info">
          <p>+123 456 789</p>
          <p>R@Reynolds.com</p>
        </div>
      </div>
    </div>
  );
}

export default App;
